func main() {
	// Load configuration
	cfg := config.NewServiceConfig("analytics", 8087)
	kafkaCfg := config.NewKafkaConfig("analytics-service")

	// Database configuration
	dbHost := config.GetEnv("ANALYTICS_DB_HOST", "localhost")
	dbPort := config.GetEnvInt("ANALYTICS_DB_PORT", 5440)
	dbUser := config.GetEnv("ANALYTICS_DB_USER", "rinder")
	dbPassword := config.GetEnv("ANALYTICS_DB_PASSWORD", "rinder123")
	dbName := config.GetEnv("ANALYTICS_DB_NAME", "rinder_analytics")
	dbSSLMode := config.GetEnv("ANALYTICS_DB_SSLMODE", "disable")

	// Initialize logger
	logger.Init(cfg.Name, cfg.LogLevel)
	logger.Info("starting analytics service",
		zap.Int("port", cfg.Port),
		zap.String("environment", cfg.Environment),
	)

	// Connect to PostgreSQL
	dsn := fmt.Sprintf("host=%s port=%d user=%s password=%s dbname=%s sslmode=%s",
		dbHost, dbPort, dbUser, dbPassword, dbName, dbSSLMode)

	db, err := sql.Open("postgres", dsn)
	if err != nil {
		logger.Fatal("failed to connect to postgres", zap.Error(err))
	}
	defer db.Close()

	// Configure connection pool
	db.SetMaxOpenConns(25)
	db.SetMaxIdleConns(5)
	db.SetConnMaxLifetime(5 * time.Minute)

	if err = db.Ping(); err != nil {
		logger.Fatal("failed to ping postgres", zap.Error(err))
	}
	logger.Info("connected to postgres database")

	// Initialize repositories
	analyticsRepo := repository.NewAnalyticsRepository(db)

	// Run migrations
	if err := analyticsRepo.CreateSchema(context.Background()); err != nil {
		logger.Fatal("failed to run database migrations", zap.Error(err))
	}
	logger.Info("database migrations completed")

	// Initialize services
	analyticsService := service.NewAnalyticsService(analyticsRepo)

	// Initialize handler
	h := handler.NewHandler(analyticsService)

	// Setup routes
	mux := http.NewServeMux()
	h.RegisterRoutes(mux)

	// Apply middleware
	var httpHandler http.Handler = mux
	httpHandler = middleware.Logging(httpHandler)
	httpHandler = middleware.Recovery(httpHandler)

	// Start Kafka consumer for all events
	eventConsumer := consumer.NewEventConsumer(kafkaCfg.Brokers, analyticsService)
	consumerCtx, consumerCancel := context.WithCancel(context.Background())
	go eventConsumer.Start(consumerCtx)

	// Create server
	server := &http.Server{
		Addr:         fmt.Sprintf(":%d", cfg.Port),
		Handler:      httpHandler,
		ReadTimeout:  15 * time.Second,
		WriteTimeout: 15 * time.Second,
		IdleTimeout:  60 * time.Second,
	}

	// Start server
	go func() {
		logger.Info("analytics service listening", zap.String("addr", server.Addr))
		if err := server.ListenAndServe(); err != nil && err != http.ErrServerClosed {
			logger.Fatal("failed to start server", zap.Error(err))
		}
	}()

	// Wait for interrupt signal
	quit := make(chan os.Signal, 1)
	signal.Notify(quit, syscall.SIGINT, syscall.SIGTERM)
	<-quit

	logger.Info("shutting down server...")

	// Stop consumer
	consumerCancel()

	// Graceful shutdown
	ctx, cancel := context.WithTimeout(context.Background(), 30*time.Second)
	defer cancel()

	if err := server.Shutdown(ctx); err != nil {
		logger.Fatal("server forced to shutdown", zap.Error(err))
	}

	logger.Info("server exited properly")
}

