func (r *AnalyticsRepository) GetOverallStats(ctx context.Context) (*model.OverallStats, error) {
	query := `
		SELECT
			COALESCE(SUM(CASE WHEN event_type = 'user.created' THEN 1 ELSE 0 END), 0) as total_users,
			COALESCE(SUM(CASE WHEN event_type = 'profile.created' THEN 1 ELSE 0 END), 0) as total_profiles,
			COALESCE(SUM(CASE WHEN event_type IN ('swipe.right', 'swipe.left') THEN 1 ELSE 0 END), 0) as total_swipes,
			COALESCE(SUM(CASE WHEN event_type = 'swipe.right' THEN 1 ELSE 0 END), 0) as right_swipes,
			COALESCE(SUM(CASE WHEN event_type = 'match.created' THEN 1 ELSE 0 END), 0) as total_matches,
			COALESCE(SUM(CASE WHEN event_type = 'media.uploaded' THEN 1 ELSE 0 END), 0) as total_media
		FROM events
	`
	var stats model.OverallStats
	var rightSwipes int64
	err := r.db.QueryRowContext(ctx, query).Scan(
		&stats.TotalUsers, &stats.TotalProfiles, &stats.TotalSwipes,
		&rightSwipes, &stats.TotalMatches, &stats.TotalMedia,
	)
	if err != nil {
		return nil, errors.Wrap(err, errors.CodeInternalServerError, "failed to get overall stats", 500)
	}

	// Calculate rates
	if stats.TotalSwipes > 0 {
		stats.SwipeRightRate = float64(rightSwipes) / float64(stats.TotalSwipes) * 100
	}
	if rightSwipes > 0 {
		stats.MatchRate = float64(stats.TotalMatches) / float64(rightSwipes) * 100
	}

	return &stats, nil
}

