func (r *AnalyticsRepository) GetDailyStats(ctx context.Context, startDate, endDate time.Time) ([]model.DailyStats, error) {
	query := `
		WITH daily_events AS (
			SELECT
				(created_at AT TIME ZONE 'UTC')::date as date,
				event_type,
				COUNT(*) as count
			FROM events
			WHERE created_at >= $1 AND created_at < $2
			GROUP BY (created_at AT TIME ZONE 'UTC')::date, event_type
		)
		SELECT
			date,
			COALESCE(SUM(CASE WHEN event_type = 'user.created' THEN count ELSE 0 END), 0) as new_users,
			COALESCE(SUM(CASE WHEN event_type = 'profile.created' THEN count ELSE 0 END), 0) as new_profiles,
			COALESCE(SUM(CASE WHEN event_type IN ('swipe.right', 'swipe.left') THEN count ELSE 0 END), 0) as total_swipes,
			COALESCE(SUM(CASE WHEN event_type = 'swipe.right' THEN count ELSE 0 END), 0) as right_swipes,
			COALESCE(SUM(CASE WHEN event_type = 'swipe.left' THEN count ELSE 0 END), 0) as left_swipes,
			COALESCE(SUM(CASE WHEN event_type = 'match.created' THEN count ELSE 0 END), 0) as new_matches,
			COALESCE(SUM(CASE WHEN event_type = 'media.uploaded' THEN count ELSE 0 END), 0) as media_uploads
		FROM daily_events
		GROUP BY date
		ORDER BY date DESC
	`
	rows, err := r.db.QueryContext(ctx, query, startDate, endDate)
	if err != nil {
		return nil, errors.Wrap(err, errors.CodeInternalServerError, "failed to get daily stats", 500)
	}
	defer rows.Close()

	var stats []model.DailyStats
	for rows.Next() {
		var s model.DailyStats
		var date time.Time
		if err := rows.Scan(&date, &s.NewUsers, &s.NewProfiles, &s.TotalSwipes,
			&s.RightSwipes, &s.LeftSwipes, &s.NewMatches, &s.MediaUploads); err != nil {
			return nil, errors.Wrap(err, errors.CodeInternalServerError, "failed to scan daily stats", 500)
		}
		s.Date = date.Format("2006-01-02")
		stats = append(stats, s)
	}

	return stats, rows.Err()
}

