func (c *EventConsumer) Start(ctx context.Context) {
	topics := []string{
		kafka.TopicUserCreated,
		kafka.TopicUserUpdated,
		kafka.TopicProfileCreated,
		kafka.TopicProfileUpdated,
		kafka.TopicProfileDeleted,
		kafka.TopicSwipeCreated,
		kafka.TopicMatchCreated,
		kafka.TopicMatchDeleted,
		kafka.TopicMediaUploaded,
		kafka.TopicMediaDeleted,
	}

	logger.Info("starting analytics event consumers",
		zap.Strings("topics", topics),
	)

	// Create a consumer for each topic
	c.consumers = kafka.NewMultiTopicConsumer(c.brokers, c.groupID, topics)

	// Register handlers for each consumer based on the topic
	for i, consumer := range c.consumers {
		topic := topics[i]
		c.registerHandlerForTopic(consumer, topic)

		// Start each consumer in its own goroutine
		go func(cons *kafka.Consumer, t string) {
			logger.Info("starting consumer for topic", zap.String("topic", t))
			if err := cons.Start(ctx); err != nil {
				logger.Error("consumer stopped with error",
					zap.String("topic", t),
					zap.Error(err),
				)
			}
		}(consumer, topic)
	}

	// Wait for context cancellation
	<-ctx.Done()
	logger.Info("shutting down analytics consumers")

	// Close all consumers
	for _, consumer := range c.consumers {
		consumer.Close()
	}
}

func (c *EventConsumer) handleUserCreated(ctx context.Context, event kafka.Event) error {
	logger.Debug("received user.created event", zap.String("event_id", event.ID))

