func ToMetadata(v interface{}) string {
	data, err := json.Marshal(v)
	if err != nil {
		return "{}"
	}
	return string(data)
}

func (r *AnalyticsRepository) RecordEvent(ctx context.Context, event *model.AnalyticsEvent) error {
	query := `
		INSERT INTO events (event_type, entity_id, user_id, metadata, created_at)
		VALUES ($1, $2, $3, $4, $5)
		RETURNING id
	`
	err := r.db.QueryRowContext(ctx, query,
		event.EventType, event.EntityID, event.UserID, event.Metadata, event.CreatedAt,
	).Scan(&event.ID)
	if err != nil {
		return errors.Wrap(err, errors.CodeInternalServerError, "failed to record event", 500)
	}
	return nil
}

